import React, {Component } from 'react';
import {Route} from 'react-router-dom';

import styles from './stylesheets/App.module.css';

import {Footer, Header} from './HeaderFooter';
import HomePage from './HomePage';
import MovieDetailPage from './MovieDetailPage';
import MyProfile from './MyProfile';
import UserLogin from './userLogin';
import UserSignUp from './userSignup';
import UserLogout from './userLogout';
import UserDelete from './userDelete';
import AllMovies from './AllMovies';

class UserApp extends Component {
    render() {
        return (
            <div className={styles.App}>
                    <Header />
                    <Route path="/" exact component = {HomePage} />
                    <Route path="/MovieDetailPage/:id" component = {MovieDetailPage } />
                    <Route path="/userLogin" exact component = {UserLogin} />
                    <Route path="/userSignup" component = {UserSignUp} />
                    <Route path="/MyProfile" component = {MyProfile} />
                    <Route path="/userLogout" exact component = {UserLogout} />
                    <Route path="/userDelete" exact component = {UserDelete} />

                    <Route path='/Telugu' exact render={ () => <AllMovies title='Telugu Movies' url='Telugu'/>} />
                    <Route path='/English' exact render={ () => <AllMovies title='English Movies' url='English'/>} />

                    <Footer />
                </div>
        )
    }}


export default UserApp;
